CREATE DEFINER=`polestarportal`@`%` PROCEDURE `bsearch`(str varchar(1000))
BEGIN
if str="" then
SET @t1 =CONCAT("select distinct(c.id),name,phone,emailID,l.location,
(SELECT GROUP_CONCAT(
(select skills from t_skills where id = tcm.skills) SEPARATOR ', ')
FROM t_candidateskillmapping tcm where candidateid = c.id GROUP BY candidateid) as skills,
st.stateName,
s.statusName,
c.resumeTitle
from t_candidate c
left  join t_location l on c.location=l.id
left join t_status s on s.id=c.status
left join t_state st on st.id=c.state
left join t_tag tg on tg.candidateID=c.id
left join t_requisition req on req.id=tg.jdID ");
 PREPARE stmt3 FROM @t1;
 EXECUTE stmt3;
 DEALLOCATE PREPARE stmt3;

else 
set @nstr=REPLACE(str,'%"',"%'");
set @lstr=REPLACE(@nstr,'"%',"'%");

set @col="concat(
ifnull(l.location,''),' ',
(SELECT GROUP_CONCAT(
(select ifnull(skills,'') from t_skills where id = tcm.skills) SEPARATOR ', ')
FROM t_candidateskillmapping tcm where candidateid = c.id GROUP BY candidateid))";

set @lstr=REPLACE(@lstr,'@col',"concat(ifnull(l.location,''),' ',(SELECT GROUP_CONCAT(
(select ifnull(skills,'') from t_skills where id = tcm.skills) SEPARATOR ', ')
FROM t_candidateskillmapping tcm where candidateid = c.id GROUP BY candidateid))");

SET @t1 =CONCAT("select c.id,name,phone,emailID,l.location,
(SELECT GROUP_CONCAT(
(select ifnull(skills,'') from t_skills where id = tcm.skills) SEPARATOR ', ')
FROM t_candidateskillmapping tcm where candidateid = c.id GROUP BY candidateid) as skills,
st.stateName,
s.statusName,
c.resumeTitle
from t_candidate c
left  join t_location l on c.location=l.id
left join t_status s on s.id=c.status
left join t_state st on st.id=c.state
left join t_tag tg on tg.candidateID=c.id
left join t_requisition req on req.id=tg.jdID 
 having ",  @lstr);
 PREPARE stmt3 FROM @t1;
 EXECUTE stmt3;
 DEALLOCATE PREPARE stmt3;
end if;
END ;;
