CREATE DEFINER=`polestarportal`@`%` PROCEDURE `Ex_getExpensemasterById`(ids int,code1 int,retalId int)
BEGIN
SELECT m.code,m.description,m.id,em.minimumBillableMandetory,em.maximumBillableMandetory,em.isActive FROM t_tex_masterdescription as m inner join t_tex_masterexmapping as em on m.id=em.masterId where m.code=code1 and m.id=ids and retailerId=retalId;
if code1=1 then
set @flag=( select id from t_tex_expensesubtable  where expenseType=ids and retailerId=retalId order by Id desc limit 1);
end if;
if code1=2 then
set @flag=( select h.id from t_tex_hotelexpense as h inner join t_tex_expensesubtable as s on h.id=s.expId where h.hotelName=ids and s.retailerId=retalId and s.expenseType=1  order by h.id desc limit 1);
if @flag is null then
set @flag=( select p.id from t_tex_perdiemexpense as p inner join t_tex_expensesubtable as s on p.id=s.expId  where hotalName=ids and s.retailerId=retalId and s.expenseType=6 order by p.id desc limit 1);
end if;
end if;
if code1=3 then
set @flag=( select t.id from t_tex_travelexpense as t inner join t_tex_expensesubtable as s on t.id=s.expId where travelType=ids and s.retailerId=retalId and s.expenseType=2 order by t.id desc limit 1);
if @flag is null then
set @flag=( select r.id from t_tex_rsdexpense as r inner join t_tex_expensesubtable as s on r.id=s.expId  where typeOfVehicle=ids and s.retailerId=retalId and s.expenseType=6 order by r.id desc limit 1);
end if;
end if;
if @flag is null then
set @flag=0;
select @flag as flag;
else
select @flag as flag;
end if;
END ;;
