CREATE DEFINER=`polestarportal`@`%` PROCEDURE `Ex_toCheckExpenseRaseOrNot`(userId int,retalId int)
BEGIN
set @days=(select DAYOFMONTH(now()));
set @a=(SELECT roleID FROM t_userdetails where id=userId);
#SELECT m.code,m.description,m.id,em.minimumBillableMandetory,em.maximumBillableMandetory,em.isActive FROM t_tex_masterdescription as m inner join t_tex_masterexmapping as em on m.id=em.masterId where m.code=1  and retailerId=retalId and em.isActive=1;
if @days<16 then
 set @expenseId=(SELECT 
ex.expenseclaimId FROM 
t_tex_expensesubtable as sub inner join t_tex_masterdescription as msd on sub.expenseType=msd.id 
 inner join t_tex_expenseclaime as ex on ex.expenseclaimId=sub.expenseclaimId inner join t_wbs as w 
on w.WBSId=sub.tripAssignment where ex.createdBy=userId and Submitted=1 and ex.createdDate BETWEEN DATE_SUB( NOW() ,INTERVAL @days day) AND NOW() order by ex.expenseclaimId desc limit 1) ;
else
set @expenseId=(SELECT ex.expenseclaimId FROM 
t_tex_expensesubtable as sub inner join t_tex_masterdescription as msd on sub.expenseType=msd.id 
 inner join t_tex_expenseclaime as ex on ex.expenseclaimId=sub.expenseclaimId inner join t_wbs as w 
on w.WBSId=sub.tripAssignment where ex.createdBy=userId and Submitted=1 and ex.createdDate BETWEEN DATE_SUB( NOW() ,INTERVAL @days-15 day) AND NOW() order by ex.expenseclaimId desc limit 1);
end if;
if @expenseId>0 or @expenseId is not null then
set @flagfor=1;
select @flagfor as flag;
else
set @flagfor=0;
select @flagfor as flag;
end if;
END ;;
