CREATE DEFINER=`polestarportal`@`%` PROCEDURE `Ex_toCopyTheExpense`(expclaimId int)
BEGIN
declare a int default 0;
declare typeid int default 0;
declare flagbill varchar(100) default null;
declare flagbill1 varchar(100) default null;
#set a=(select count(id) from t_tex_expensesubtable where expenseclaimId=expclaimId
insert into t_tex_expenseclaime(fromdate,toDate,totalExpense,anyFile,Submitted,claimedStatus,CreatedDate,createdBy,modifyDate,modifiedBy,ledgerId ) select fromdate,toDate,totalExpense,anyFile,Submitted,claimedStatus,CreatedDate,createdBy,modifyDate,modifiedBy,ledgerId from t_tex_expenseclaime where expenseclaimId=expclaimId;
set @currentclaimId=Last_insert_ID();
update t_tex_expenseclaime set Submitted=0,claimedStatus=0,modifyDate=now() where expenseclaimId=@currentclaimId;
set @b=(select group_concat(id) from t_tex_expensesubtable where expenseclaimId=expclaimId);

 simple_loop: LOOP
set a=a+1;
set typeid=SPLIT_STR(@b,',',a);
if typeid>0 then
insert into t_tex_expensesubtable( expId,expenseType,currencyId,totalExpense,fromDate,toDate,expenseclaimId,tripAssignment,anyFile,retailerId ) select  expId,expenseType,currencyId,totalExpense,fromDate,toDate,expenseclaimId,tripAssignment,anyFile,retailerId from t_tex_expensesubtable where id=typeid;
set @currentId=Last_insert_ID();
update t_tex_expensesubtable set expenseclaimId=@currentclaimId where id=@currentId;
else
leave simple_loop ;
end if;

end LOOP simple_loop ;
END ;;
