CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_addrequisition`(in createdby int(11)
,in title varchar(500),in positions int(11),in skills varchar(1000)
,in minimum int(20),in maximum int(20),in expir varchar(100)
,in location varchar(250),in description1 text,
in desig varchar(250),in recruiter1 varchar(250),in exp VARCHAR(500)
,in admin int(11),in flag int(2),in idn int(11),priorityid int,
jobtype int,roleId1 int,retId int)
BEGIN
declare rid int(11);
declare expdate int;
declare recr varchar(250);
declare priority int;
declare desption varchar(5000);

if priorityid=1 then
set @priorityname='Normal';
end if;

if priorityid=2 then
set @priorityname='Urgent';
end if;

if flag=0 then
select flag as flag;
insert into t_requisition(
`createdBy`,`title`,
`positions`,`minimumSalary`,
`maximumSalary`,`location`,
`expireDate`,`description`,`designation`,`recruiter`,
`Experience`,`adminHr`,`priority`,`createdDate`,`modifiedDate`,`jobType`,`modifiedBy`,`retailerId`)
values(createdby,title,positions,minimum,maximum,location,expir,
description1,desig,recruiter1,exp,admin,priorityid,now(),now(),jobtype,createdBy,retId);
set rid=last_insert_id();
select rid;
call usp_split_nr(skills,',','skilltable');
insert into t_maprequisitionsskills(`skill`,`requisitionId`)  select variable,rid from skilltable ;

drop table skilltable;

end if;
#select isconfirmed from t_requisition where id=idn;
if flag=1 then
select flag as flag;
if (select isconfirmed from t_requisition where id=idn)=0 then

update t_requisition t set 
t.title=title,
t.positions=positions,
t.minimumSalary=minimum,t.maximumSalary=maximum,
t.location=location,
t.designation=desig,t.recruiter=recruiter1,
t.expireDate=expir,t.description=description1,t.Experience=exp,
t.adminHr=admin,t.edit=t.edit-1,t.mailCounter = (t.mailCounter+1),
t.modifiedDate=now(),
t.jobType=jobtype,
t.modifiedBy=createdby
 where t.id=idn;
set rid =idn;
delete from t_maprequisitionsskills where requisitionId=idn;
call usp_split_nr(skills,',','skilltable');
insert into t_maprequisitionsskills(`skill`,`requisitionId`)  select variable,rid from skilltable ;
drop table skilltable;
end if;

#select * from t_requisition where id=idn;
if (select isconfirmed from t_requisition where id=idn)=1  or
 (select isconfirmed from t_requisition where id=idn)=2 then

select expireDate from t_requisition where id=idn into @expdate;
select recruiter from t_requisition where id=idn into @recr;
set @pid = (select t.priority from t_requisition t where t.id=idn);
select description from t_requisition where id=idn into @desption;

if @expdate != expir then
insert into t_requisitionHistory(`jdid`,`columnName`,`description`,`modifiedBy`,`modifiedDate`,`retailerId`)
values(idn,'Expiry Date',expir,createdby,now(),retId);
end if;

if @recr!=recruiter1 then
insert into t_requisitionHistory(`jdid`,`columnName`,`description`,`modifiedBy`,`modifiedDate`)
values(idn,'Interviewer',recruiter1,createdby,now());
end if;

if @pid!=priorityid then
insert into t_requisitionHistory(`jdid`,`columnName`,`description`,`modifiedBy`,`modifiedDate`)
values(idn,'Priority',@priorityname,createdby,now());
end if;

if @desption!=description1 then
insert into t_requisitionHistory(`jdid`,`columnName`,`description`,`modifiedBy`,`modifiedDate`)
values(idn,'Description',description1,createdby,now());
end if;

update t_requisition t 
set t.recruiter=recruiter1,
t.priority=priorityid,
t.expireDate=expir,
t.description=description1,
t.edit=t.edit-1,
t.mailCounter = (t.mailCounter+1),
t.modifiedDate=now()
 where t.id=idn;
end if;
end if;
select rid as id ;
SELECT requisitionId, GROUP_CONCAT((select skills from t_skills where id = skill) SEPARATOR ', ') as skills
FROM t_maprequisitionsskills where requisitionId = rid GROUP BY requisitionId ;
select isconfirmed,mailCounter from t_requisition where id=idn;
if roleId1 = 5 then
select userEmail from t_userdetails where hrRole = 6;
end if;
if roleId1 = 3 then
select userEmail from t_userdetails where id  = (select managerId from t_userdetails where id = createdby);
end if;
END ;;
DELIMITER ;
