CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_AdvancedSearch`(
cname varchar(500),
jdtitle varchar(500),
emaili varchar(500),
loc varchar(500)
)
BEGIN
SET @t1 =CONCAT("Select distinct(a.id),a.name,a.phone,a.emailID,a.location,a.skills,a.stateName,
a.statusName,a.resumeTitle
 from (
select c.id,name,phone,emailID,l.location,
(SELECT GROUP_CONCAT(
(select skills from t_skills where id = tcm.skills) SEPARATOR ', ')
FROM t_candidateskillmapping tcm where candidateid = c.id GROUP BY candidateid) as skills,
st.stateName,
s.statusName,
c.resumeTitle,req.title
from t_candidate c
left  join t_location l on c.location=l.id
left join t_status s on s.id=c.status
left join t_state st on st.id=c.state
left join t_tag tg on tg.candidateID=c.id
left join t_requisition req on req.id=tg.jdID
having
ifnull(name,'') like '%",cname,"%' And
ifnull(title,'') like '%",jdtitle,"%'And
ifnull(emailID,'') like '%",emaili,"%'And 
ifnull(l.location,'') like '%",loc,"%') as a" ) ;

 PREPARE stmt3 FROM @t1;
 EXECUTE stmt3;
 DEALLOCATE PREPARE stmt3;
END ;;
