declare allskill varchar(500) ;
select *,(SELECT GROUP_CONCAT((select skills from t_skills where id = skill) SEPARATOR ', ') as skills
FROM t_maprequisitionsskills where requisitionId = r.id GROUP BY requisitionId ) as skills
  from t_requisition r where isActive = 1 and r.retailerId=retId
order  by isConfirmed desc;
select * from t_skills ;
select * from t_location;
select t.id,t.firstName from t_userdetails t where hrRole = 1 and retailerId=retId;
select * from t_designation;
select * from t_priority;
