CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_allRequisitionsHod`(uid int,retId int)
BEGIN
declare allskill varchar(500) ;
select
r.id,r.title,r.positions,hod.id as HOD,
r.experience,r.assignedTo,r.recruiter,r.isConfirmed,r.createdBy,
