softType varchar(45),
vendor varchar(45),
invoiceDate datetime,
typel varchar(45),
description varchar(100),licenceRqd varchar(4),
licenceKey varchar(100),
users int(11),licenceExpDate datetime, licencePurchaseDate datetime,
