if lag='1' then
select a.AID,b.attribute,a.attNo from t_attName a inner join t_attributes b on a.AID=b.id
where a.ACID=cid and a.flag='0';
select a.AID,b.attribute,a.attNo from t_attName a inner join t_attributes b on a.AID=b.id
where a.ACID=cid and a.flag='1';
end if;

END ;;
