    `invoiceNo`,
    `name`
FROM `t_ast_header` where atid=4 and isActive=1;
end if;
if temp=1 then
#select * from EAM.t_header where uprice is not null;
SELECT `id`,
    `ACID`,
    `purchaseOrder`,
    `quantity`,
   # `t_header`.`deliveryDate`,
   DATE_FORMAT(`deliveryDate`,'%Y-%m-%d') deliveryDate,
    `vendor`,
    `createdDate`,
