    `invoiceAmt`,
    #`t_header`.`invoiceDate`,
     DATE_FORMAT(`invoiceDate`,'%Y-%m-%d') invoiceDate,
    `invoiceNo`,
    `name`,
    `uprice`,
    `color`,
    `brand`
FROM t_ast_header where atid=3 and isActive=1;
end if;
if temp=3 then
#select * from EAM.t_header where uprice is not null;
SELECT `id`,
    `ACID`,
    `softType`,`vendor`,
   # `t_header`.`deliveryDate`,   
    #`t_header`.`invoiceDate`,
