CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_bug_addbug`(
userid int,
project int,
status varchar(50),
assingedto int,
priority varchar(50),
severity varchar(50),
technology varchar(50),
type varchar(50),
tentativeclosure varchar(50),
titlebox varchar(200),
description varchar(1000),
filepath varchar(200),
filename varchar(400),
orignalfilename varchar(200),

inDetectedby int,
inCycle int,
retid int
)
BEGIN
Select userEmail as emailId ,userPassword as pass from t_userdetails where id=assingedto;

select id from t_mastersdescription where code=
(select code from t_master where tablename = 'Status') 
AND isActive=1 and description1='New' into @stid;

INSERT INTO `t_bug_bugdetails`
(
`userId`,
`projectId`,
`assingedToUserId`,
`technology`,
`priority`,
`severity`,
`status`,
`type`,
`bugTitle`,
`bugDescription`,
`createdDate`,
`effectiveStartDate`,
`effectiveEndDate`,
`lastModifiedDate`,
`retailerId`,
`createdBy`,
`lastModifiedBy`,
cycle,
detectedby
)
VALUES
(
userid,
project ,
assingedto ,
technology ,
priority ,
severity ,
@stid ,
type  ,
titlebox  ,
description ,
now(),
now(),
(select STR_TO_DATE(tentativeclosure, '%m/%d/%Y')),
now(),
retid,
userid,
userid,
inCycle,
inDetectedby
);

set @bugid=LAST_INSERT_ID();
if filepath is not null then
INSERT INTO  `t_bug_attachments`
(
`bugId`,
`userId`,
`filePath`,
`fileName`,
`orignalFileName`,
`uploadDate`,
`createdDate`,
`createdBy`,
`lastModifiedDate`,
`lastModifiedBy`,
`retailerId`
)
VALUES
(
@bugid,
userid,
ifnull(filepath,''),
ifnull(filename,'') ,
ifnull(orignalfilename,''),
now(),
now(),
userid,
now(),
userid,
retid
);
end if;

END ;;
