CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_bug_raiseBug`(
uid int,rid int,retid int
)
BEGIN

select id from t_projectdetails where
 retailerId=retid and isActive=1 limit 1 into @tempid;

Select isClient from t_userdetails
 where id=uid into @ifClient;

if @ifClient=1 then set rid=3; end if;

if rid=3 then
/*
select * from t_projectdetails where retailerId=retid and isActive=1 and
clientid in (select clientId from t_userdetails u where u.id=uid and isClient=1);
*/
Select p.* from t_projectclientmapping pm 
inner join t_userdetails u on pm.cname=u.clientId
inner join t_projectdetails p on p.id=pm.pid
 where u.id=uid and isClient=@ifClient and 
p.retailerId=retid and p.isActive=1 ;

else

if rid=1 then
Select p.* from t_projectdetails p  where  p.retailerId=retid   and p.isActive=1;

else
Select p.* from t_projectdetails p  inner join t_projectresourcemapping r on p.id=r.projectId 
where r.userId=uid and p.retailerId=retid   and p.isActive=1
;

end if;
#select * from t_projectdetails where retailerId=retid   and isActive=1;
end if;
select * from t_mastersdescription where 
code=(select code from t_master where tablename = 'Status') AND isActive=1 and (flag=1 or retailerId=retid);

#select * from t_userdetails where retailerId=retid and isActive=1;
 select * from t_userdetails where id in(
 Select userId from t_projectresourcemapping where
 projectId=@tempid) and isActive=1 ;

select * from t_mastersdescription where code=(select code from t_master where tablename = 'Priority') AND isActive=1 and (flag=1 or retailerId=retid);

select * from t_mastersdescription where code=(select code from t_master where tablename = 'Severity') AND isActive=1 and (flag=1 or retailerId=retid);

#select * from t_mastersdescription where code=(select code from t_master where tablename = 'technology') AND isActive=1;

select d.* from t_mastersdescription 
d inner join t_projecttechnologymapping t on t.technologyId=d.id
 where d.code=
(select code from t_master where tablename = 'Technology')
 AND d.isActive=1
And   t.projectId = @tempid and (d.flag=1 or d.retailerId=retid);

select * from t_mastersdescription where code=(select code from t_master where tablename = 'Type') AND isActive=1 and (flag=1 or retailerId=retid);
select * from t_mastersdescription where code=
(select code from t_master where tablename = 'Cycle') AND isActive=1 and (flag=1 or retailerId=retid);
Select DISTINCT id,concat(firstName,' ' ,lastName) as Name from t_userdetails where retailerid=retid;
END ;;
