CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_bug_updatebugdetails`(
bugid int,colname varchar(100),value1 varchar(10000),user varchar(50)
)
BEGIN
declare changeby varchar(100);
declare cStatus varchar(100);

select md.description1 from t_mastersdescription md 
where md.id=value1 into cStatus; 
If(colname='Status') then 
Set changeby=(Select concat(firstname,' ',lastname) from t_userdetails
 where id=user );
INSERT INTO `t_bug_comments`
(
`bugId`,
`userId`,
`comments`,
`createdDate`,
`createdBy`,
`retailerId`,
`lastModifiedDate`,
`lastModifiedBy`)
Select  b.id,b.`assingedToUserId`,concat('Last Status : ',Ifnull(md.`description1`,''),' 
 Current Status : ',Ifnull(cStatus,'') ,'   Updated By : ',changeby), 
 b.`createdDate`,b.`createdBy`,b.`retailerId`,
    Now(),user from t_bug_bugdetails b   join t_mastersdescription md on md.id=b.status 
where b.id=bugid;


end if;

if(colname!='effectiveEndDate') then
SET @s = CONCAT('UPDATE t_bug_bugdetails set ',colname,'="',value1,'",
lastModifiedDate = now(),lastModifiedBy=',user,' where id= ',bugid);
insert into t_bug_history (`bugId`,`master`,`masterDescription`,`modifiedDate`,`modifiedBy`) 
values (bugid,(select code from t_master where tableName=colname),value1,now(),user);

    PREPARE stmt FROM @s;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;
    else
    UPDATE t_bug_bugdetails set effectiveEndDate=STR_TO_DATE(value1,'%m/%d/%Y'),
    lastModifiedDate = now(),lastModifiedBy=user
    where id=bugid;
    end if;  
    Select b.*,s.description1 from t_bug_bugdetails b inner join t_userdetails u
 on b.assingedToUserId=u.id 
 inner join (select * from t_mastersdescription where code=1) as s
 on b.status=s.id
 where b.id=bugid;
   # Select * from t_bug b inner join t_userdetails u on b.assingedToUserId=u.id where b.id=bugid;
If(colname='Status' and value1=4) then     
     Select * from t_bug_bugdetails b inner join 
	t_userdetails u on b.createdBy=u.id where b.id=bugid;
     else     
     Select '' as userEmail;
     end if;
    
END ;;
DELIMITER ;
