CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_changeAssignmentStatus`(aid int)
BEGIN
select isActive from t_assignment where id=aid into @tempstatus;
if @tempstatus=1 then
UPDATE t_assignment
SET
isActive = 0,
deActivationDate=date_format(now(),'%m/%d/%y')
where id=aid ;
else
set @asdat=(select AssignmentEndDate from t_assignment where id=aid);
UPDATE t_assignment
SET
isActive = 1,
deActivationDate=@asdat
where id=aid ;
end if;
END ;;
