uid int,npassword varchar(50), oldpassword varchar(50)
 )
BEGIN
declare i int default 1;
set @temp = (select t.userPassword from t_userdetails t Where t.id=uid) ;

if @temp=oldpassword then
select i ;

update t_userdetails
set `userPassword`=npassword where id=uid;

update t_retailer
set `password`=npassword where id=(select retailerId from t_userdetails where id=uid);

else 
set i=0;
select i;

end if;


end ;;
