CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_confirmrequisition`(idnew int(11),flag int(11),
count int(11),uid int,role int)
BEGIN
declare confirmInt int(11);
declare countFromDb int(11);
set countFromDb = (select mailCounter from t_requisition where id = idnew);
set confirmInt = (select isConfirmed from t_requisition where id = idnew);
if countFromDb = count then
if role = 3 then
if confirmInt =  0 then
 update t_requisition set isConfirmed = flag,reviewedBy=uid where id = idnew;
  select 'success' as id ;
SELECT GROUP_CONCAT((select skills from t_skills where id = skill) SEPARATOR ', ') as skills
FROM t_maprequisitionsskills where requisitionId = idnew GROUP BY requisitionId ;
select R.*, L.location as locationName from t_requisition R left join t_location L on R.location = L.id  where R.id = idnew;
if flag = 1 then
select email from t_userdetails where roleId = 6;
else select  email from t_userdetails where id = uid union select email from t_userdetails where id = (select managerId from t_userdetails u where u.id = uid);
end if;
else
	select isConfirmed  as id from t_requisition where id = idnew;
end if;
end if;
if role = 5 then
if confirmInt =  1 then
 update t_requisition set isConfirmed = flag,reviewedBy=uid where id = idnew;
  select 'success' as id ;

SELECT GROUP_CONCAT((select skills from t_skills where id = skill) SEPARATOR ', ') as skills
FROM t_maprequisitionsskills where requisitionId = idnew GROUP BY requisitionId ;
select R.*, L.location as locationName from t_requisition R left join t_location L on R.location = L.id  where R.id = idnew;
select email from t_userdetails where roleId = 6 union select email from t_userdetails u where u.Id = (select createdBy from t_requisition r where r.id = idnew) ;
else
	select isConfirmed  as id from t_requisition where id = idnew;
end if;

end if;
else select 'not latest' as id;
end if;

END ;;
DELIMITER ;
