CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_docmaster`(
 in user  int ,in role  int, inretailer  int, in type int , in oldname varchar(30), in
inname  varchar(30) ,in flag  int  ,in crole  int)
BEGIN
Declare id1 int default -2 ;
Declare id2 int default -2 ;
Declare c1 int default -2 ;
Declare active1 int default -2 ;
Declare ls int default -2 ;
set id1=(select id from t_doc_verticalvalues where retailerid=inretailer and verticalid=`type` and `values`=inname);
set id2=(select id from t_doc_verticalvalues where retailerid=inretailer and verticalid=`type` and `values`=oldname);

if flag=0 then
	
	#set c1=(select count(' ')from t_doc_attachrolemap where verticalvalues_id=id2);
	#if c1=0 then 
		update t_doc_verticalvalues set Active=0 where id=id2;
	#else
	#	set active1 =1 ;                                 
	#end if ;
end if ;
if flag=1 then
	#set id1=(select id from t_doc_verticalvalues where retailerid=inretailer and `values`=inname);
	update t_doc_verticalvalues set Active=1 where id=id2;
end if ;
if flag=2 then
	set c1=(select count(' ')from t_doc_verticalvalues where retailerid=inretailer and verticalid=`type` and `values`=inname and id!=id2);
	if c1=0 then
		update t_doc_verticalvalues set `values`=inname where  retailerid=inretailer and verticalid=`type` and `values`=oldname ;
	else 
		set active1 =2 ; 
	end if ;
end if ;
if flag=3 then
	set c1=(select count(' ')from t_doc_verticalvalues where retailerid=inretailer and verticalid=`type` and `values`=inname );
	if c1=0 then
	INSERT INTO t_doc_verticalvalues (verticalid,`values`,Active,retailerid)
	VALUES (type,inname,1,inretailer);
	set ls = last_insert_id(); 
	INSERT INTO t_doc_attachrolemap (crole_id,vertical_id,verticalvalues_id)
		VALUES (crole,type,ls);		
	
	else 
		set active1 =3 ;
	end if ;
end if ;
select active1 , inname;  
END ;;
DELIMITER ;
