if cusId =0 then
insert into t_doc_customrole (description,retailerId) values (cusRole,retId);
set @lid=LAST_INSERT_ID();
insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
 ( select @lid ,1, variable from temp1); 
