CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_doc_customRoleUpdate`(
in retId int,in cusId varchar(255),
in cusRole varchar(255),in industry_name varchar(255),
business_name varchar(255),document_type varchar(255),
tech varchar(255),res_level varchar(255),
indhide varchar(255),busshide varchar(255),
dochide varchar(255),techide varchar(255),
rlevelhide varchar(255),in isActive varchar(10))
BEGIN

call `usp_split_nr` (industry_name,',','temp1');
call `usp_split_nr` (business_name,',','temp2');
call `usp_split_nr` (document_type,',','temp3');
call `usp_split_nr` (tech,',','temp4');
call `usp_split_nr` (res_level,',','temp5');

if cusId =0 then
	Select count(1) from t_doc_customrole where description=cusRole 
	and  retailerId=retId into @ifExist;
	if @ifExist=0  then 
		insert into t_doc_customrole
		(description,retailerId,Active)
		values (cusRole,retId,isActive);
		set @lid=LAST_INSERT_ID();
		insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
		 ( select @lid ,1, variable from temp1); 
		drop table temp1;
		insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
		 ( select @lid ,2, variable from temp2); 
		drop table temp2;
		insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
		 ( select @lid ,3, variable from temp3); 
		drop table temp3;
		insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
		 ( select @lid ,4, variable from temp4); 
		drop table temp4;
		insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
		 ( select @lid ,5, variable from temp5); 
		drop table temp5;
		select 1 as flag;
		select @lid as id;
	else
		select 3 as flag;
	end if ;
	
else
		Select count(1) from t_doc_customrole where description=cusRole
		 and retailerId=retId and id !=cusId into @ifExist;
		select count(1) from t_userdetails where crole_id=cusId  and retailerId=retId 
		 into @ifExistUser;

		if @ifExist=0  and isActive=1  then
				delete from t_doc_attachrolemap where crole_id=cusId;
				update t_doc_customrole set  Active=isActive , `description`=cusRole , 
				retailerId=retId  where id=cusId;
				insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
				 ( select cusId ,1, variable from temp1); 
				drop table temp1;

				insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
				 ( select cusId,2, variable from temp2); 
				drop table temp2;

				insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
				 ( select cusId,3, variable from temp3); 
				drop table temp3;


				insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
				 ( select cusId ,4, variable from temp4); 
				drop table temp4;

				insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
				 ( select cusId ,5, variable from temp5); 
				drop table temp5;
				select 2 as flag;
		else
		
		if @ifExist=0 and isActive=0 and @ifExistUser=0 then
				update t_doc_customrole set  Active=isActive ,
				`description`=cusRole , 
				retailerId=retId  where id=cusId;

				delete from t_doc_attachrolemap where crole_id=cusId;
				
				insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
				 ( select cusId ,1, variable from temp1); 
				drop table temp1;

				insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
				 ( select cusId,2, variable from temp2); 
				drop table temp2;

				insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
				 ( select cusId,3, variable from temp3); 
				drop table temp3;


				insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
				 ( select cusId ,4, variable from temp4); 
				drop table temp4;

				insert into t_doc_attachrolemap(`crole_id`,`vertical_id`,`verticalvalues_id`) 
				 ( select cusId ,5, variable from temp5); 
				drop table temp5;
				select 5 as flag ;
		else
				select 4 as flag;
		end if ;
    end if;
	
end if;
end ;;
