CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_Ex_tocheckWbsDate`(wbsId1 int,startdate varchar(100),enddate varchar(100))
BEGIN
set @todate=(select date_format(str_to_date(startdate, '%Y-%m-%d'),'%d/%m/%Y'));
set @fromdate=(select date_format(str_to_date(enddate, '%Y-%m-%d'),'%d/%m/%Y'));
set @ides=(SELECT WBSID FROM portal.t_wbs where  @todate>=wplannedStartDate and
 @fromdate<=wplannedEndDate and WBSID=wbsId1);
if @ides>0 or @ides is not null then
set @flag=1;
select @flag as flag;
else
set @flag=0;
select @flag as flag;
end if;
END ;;
