CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_ex_updateMasterforExpense`(code int, 
    des1 varchar(500),des2 int,des3 int,mby int,active tinyint(2), id1 int,retailID int)
BEGIN
Select count(1) from t_tex_masterdescription as m inner join t_tex_masterexmapping as mp
 on m.id=mp.masterId where
 m.code=code and
 m.description=des1 and
 mp.retailerId=retailID 
and m.id!=id1
into @ifExist;




if @ifExist=0  then

update t_tex_masterdescription set code=code,description=des1,minimumBillableMandetory=des2,
maximumBillableMandetory=des3,modifyDate=now(),modifiedBy=mby,isActive=active
  where id=id1;

update t_tex_masterexmapping set minimumBillableMandetory=des2,
maximumBillableMandetory=des3,modifyDate=now(),modifiedBy=mby,isActive=active
  where masterId=id1 and code=code and retailerId=retailID;

   set @flags=1000;   
select @flags as flag;
end if;  

Select @ifExist as flag;
END ;;
