CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_getAllClientsById`(in inClientId int, in inRoleId int,
in inRetailerId int,in inIsActive varchar(255))
BEGIN
declare temp int default 1;
if inIsActive='false' then
set temp = 1 ;
end if ;
if inIsActive='true' then
set temp=0 ;
end if ;
if inIsActive='all' then
set temp=2 ;
end if ;


select * from t_location;
select * from t_userdetails where roleId in (4,1) and retailerId=inRetailerId;

If inClientId is not Null and inRoleId is not null and inRetailerId is not null THEN
if temp=1 or temp=0 then
SELECT c.*,t.location as locName,concat(u.firstName,' ', u.lastName)as leadName
 FROM t_clients  c
 left join t_location t on c.location=t.id
left join t_userdetails u on c.clientAccountLead=u.id
where c.isActive=temp and c.retailerId = inRetailerId
and (inClientId = 0 or c.id = inClientId);
else
SELECT c.*,t.location as locName,concat(u.firstName,' ', u.lastName)as leadName
 FROM t_clients  c
 left join t_location t on c.location=t.id
left join t_userdetails u on c.clientAccountLead=u.id
where  c.retailerId = inRetailerId
and (inClientId = 0 or c.id = inClientId);
end if;
end if ;
END ;;
DELIMITER ;
