CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_getAllProjects`(in inUserId int, in inRoleId int,
in inRetailerId int)
BEGIN
If inUserId is not Null and inRoleId is not null and inRetailerId is not null THEN
Select 
    u.`id`,
    u.`projectTitle`,
    u.`pcode`,
    u.`ptype`,
   u.`description`,
    u.`plannedStartDate`
, u.`plannedEndDate`
   , u.`actualStartDate`,
    u.`actualEndDate`,
    u.`pstatus`,
    u.`pcomplexity`,
    u.`plocation`,
    u.`commercialHead`,
    u.`accountHead`,
    u.`manager`,
    u.`teamLead`,
	concat(ud.firstName,' ',ud.lastName) as lastupdatedby,
sum(case when b.status =1 then 1 else 0 end ) as openbug,
sum(case when b.status =4 then 1 else 0 end ) as closedbug
from
    t_projectdetails u
        inner join
    t_retailer l ON u.retailerId = l.id
left join t_userdetails ud on u.lastModifiedBy=ud.id
left join t_bug_bugdetails b on u.id=b.projectId
        
where
    
     u.retailerId=inRetailerId and u.isActive=1 group by u.id;


end if;

END ;;
