CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_getAllTag`(id int,retId int)
BEGIN
#tagged jd's of cdt with jd title
select t.id as tagId,c.name,t.candidateID,t.jdID,r.title from t_tag t 
left outer join t_requisition r on t.jdID=r.id
 inner join t_candidate c on c.id=t.candidateID
 where t.candidateID=id;
#to show all HM
select u.id,u.firstName from 
t_userdetails u where hrRole in(3,5) and retailerId=retId;
#to get cdt name
select ct.id,ct.name from t_candidate ct where ct.id=id;
#to get state and status of the candidate
/*SELECT s.stateName,sa.statusName,t.jdID
,t.candidateID FROM hr_management.t_tag t 
left join t_action a on t.candidateID=a.candidateID
left join t_state s on a.state=s.id
left join t_status sa on a.status=sa.id
 where t.candidateID=id  and a.status=(select max(status) from t_action) ;
*/
Select a.candidateID,a.jdID,b.stateName,b.statusName from (Select candidateID,jdID,
mAX(COnvert(concat(state,status),UNSIGNED INTEGER )) as MaxStatus
 from t_action 
where
candidateid=id  Group by jdid)a inner join (
Select t.candidateID,t.jdID,
COnvert(concat(t.state,t.status),UNSIGNED INTEGER ) as tempStatus,
t.state,t.status,st.stateName
,sa.statusName
 from t_action t left join t_state st on t.state=st.id
left join t_status sa on t.status=sa.id
where
t.candidateid=id) b  on a.candidateID=b.candidateID And a.jdID=b.jdID And
a.MaxStatus=b.tempStatus;


select * from t_state;

END ;;
DELIMITER ;
