CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_getbugtoexport`(uid int,roleid int,retid int)
BEGIN
if(roleid=1) then 

SELECT @rownum:=@rownum + 1 as Sno, 
       t.*
FROM ( 
select
b.bugTitle,
p.projectTitle ,
st.description1 as status,
pt.description1 as priority,
svt.description1 as severity,
tec.description1 as technology,
concat(ud.firstName,' ',ud.lastName) as assignedto,
DATE_FORMAT(b.effectiveStartDate,'%d/%m/%Y') as startdate,
DATE_FORMAT(b.effectiveEndDate,'%d/%m/%Y') as endDate

from t_bug_bugdetails b
join t_userdetails u on u.id=b.assingedToUserId
join t_projectdetails p on p.id=b.projectId

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'Status')
 and  (flag=1 or retailerId=retid)
) st on st.id=b.status

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'Priority')
 and  (flag=1 or retailerId=retid)
) pt on pt.id=b.priority


left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'severity') 
and  (flag=1 or retailerId=retid)
) svt on svt.id=b.severity

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'technology') and  (flag=1 or retailerId=retid)
) tec on tec.id=b.technology

left join t_userdetails ud on ud.id=b.assingedToUserId

 where b.retailerId=retid 
 
 
order by(b.lastModifiedDate) desc 


) t,
(SELECT @rownum := 0) r;

else 
if(roleid=3) then 

SELECT @rownum:=@rownum + 1 as Sno, 
       t.*
FROM ( 
select
b.bugTitle,
p.projectTitle ,
st.description1 as status,
pt.description1 as priority,
svt.description1 as severity,
tec.description1 as technology,
concat(ud.firstName,' ',ud.lastName) as assignedto,
DATE_FORMAT(b.effectiveStartDate,'%d/%m/%Y'),
DATE_FORMAT(b.effectiveEndDate,'%d/%m/%Y')


from t_bug_bugdetails b
join t_userdetails u on u.id=b.assingedToUserId
join t_projectdetails p on p.id=b.projectId 

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'Status') and  (flag=1 or retailerId=3)
) st on st.id=b.status

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'Priority') and  (flag=1 or retailerId=3)
) pt on pt.id=b.priority


left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'severity') and  (flag=1 or retailerId=3)
) svt on svt.id=b.severity

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'technology') and  (flag=1 or retailerId=3)
) tec on tec.id=b.technology

left join t_userdetails ud on ud.id=b.assingedToUserId

where b.retailerId=retid and p.id in (Select p.id from t_user u inner join
 t_projectdetails p on p.clientID=u.clientID where u.id=uid)
 
 
order by(b.lastModifiedDate) desc 


) t,
(SELECT @rownum := 0) r;

else
if(roleid=4) then 
 
SELECT @rownum:=@rownum + 1 as Sno, 
       t.*
FROM ( 
select
b.bugTitle,
p.projectTitle ,
st.description1 as status,
pt.description1 as priority,
svt.description1 as severity,
tec.description1 as technology,
concat(ud.firstName,' ',ud.lastName) as assignedto,
DATE_FORMAT(b.effectiveStartDate,'%d/%m/%Y'),
DATE_FORMAT(b.effectiveEndDate,'%d/%m/%Y')

from t_bug_bugdetails b
join t_userdetails u on u.id=b.assingedToUserId
join t_projectdetails p on p.id=b.projectId 

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'Status') and  (flag=1 or retailerId=3)
) st on st.id=b.status

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'Priority') and  (flag=1 or retailerId=3)
) pt on pt.id=b.priority


left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'severity') and  (flag=1 or retailerId=3)
) svt on svt.id=b.severity

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'technology') and  (flag=1 or retailerId=3)
) tec on tec.id=b.technology

left join t_userdetails ud on ud.id=b.assingedToUserId

 where b.retailerId=retid and p.id in ((Select projectId from
 t_projectresourcemapping where userId=uid)
 )
 
order by(b.lastModifiedDate) desc 


) t,
(SELECT @rownum := 0) r;
else


SELECT @rownum:=@rownum + 1 as Sno, 
       t.*
FROM ( 
select
b.bugTitle,
p.projectTitle ,
st.description1 as status,
pt.description1 as priority,
svt.description1 as severity,
tec.description1 as technology,
concat(ud.firstName,' ',ud.lastName) as assignedto,
DATE_FORMAT(b.effectiveStartDate,'%d/%m/%Y'),
DATE_FORMAT(b.effectiveEndDate,'%d/%m/%Y')


from t_bug_bugdetails b
join t_userdetails u on u.id=b.assingedToUserId
join t_projectdetails p on p.id=b.projectId 

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'Status') and  (flag=1 or retailerId=3)
) st on st.id=b.status

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'Priority') and  (flag=1 or retailerId=3)
) pt on pt.id=b.priority


left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'severity') and  (flag=1 or retailerId=3)
) svt on svt.id=b.severity

left join (select * from t_mastersdescription 
where code=(select code from t_master where tablename = 'technology') and  (flag=1 or retailerId=3)
) tec on tec.id=b.technology

left join t_userdetails ud on ud.id=b.assingedToUserId

 where b.retailerId=retid and b.assingedToUserId=uid or b.userId=uid
 
 
order by(b.lastModifiedDate) desc 


) t,
(SELECT @rownum := 0) r;

end if;
end if;
end if;
END ;;
