CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_globalSearch`(str varchar(500))
BEGIN
SET @t1 =CONCAT("select c.id,name,phone,emailID,l.location,
(SELECT GROUP_CONCAT(
(select skills from t_skills where id = tcm.skills) SEPARATOR ', ')
FROM t_candidateskillmapping tcm where candidateid = c.id GROUP BY candidateid) as skills,
st.stateName,
s.statusName,
c.resumeTitle
from t_candidate c
left  join t_location l on c.location=l.id
left join t_status s on s.id=c.status
left join t_state st on st.id=c.state
left join t_tag tg on tg.candidateID=c.id
left join t_requisition req on req.id=tg.jdID group by candidateID
 having
name like '%",str,"%' or
group_concat(req.title separator ',') like '%",str,"%' or
emailID like '%",str,"%' or
location like '%",str,"%' or
skills like '%",str,"%'");

 PREPARE stmt3 FROM @t1;

 EXECUTE stmt3;
 DEALLOCATE PREPARE stmt3;

END ;;
DELIMITER ;
