CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_hrUserReq`(uid int)
BEGIN
select *,(SELECT GROUP_CONCAT((select skills from t_skills where id = skill) SEPARATOR ', ') as skills
FROM t_maprequisitionsskills where requisitionId = r.id GROUP BY requisitionId ) as skills,
(select name from t_userdetails u where u.id = assignedTo) as assignedToName,
(select name from t_userdetails where id = adminHr) as adminHrname 
from t_requisition r
where isConfirmed =2 and assignedTo=uid;
END ;;
