CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_interviewedData`(
intid int,
rting int,
approve int,
timetkn int,
rmk varchar(500),
uid int,
stateid int,
cdtid int,
modeid int,
round int,
feed varchar(200),
jdid int
)
BEGIN

if timetkn is not null then
UPDATE `hr_management`.`t_scheduleinterview`
SET
`isDone` = 1,
`statusId` =approve,
`modifiedDate` = now(),
`modifiedBy` = uid,
`isApproved` = approve,
`timeTaken` = timetkn,
`rating` = rting,
`remarks` = rmk,
`feedbackForm`=feed
WHERE `id` = intid;
else
UPDATE `hr_management`.`t_scheduleinterview`
SET
`modifiedDate` = now(),
`modifiedBy` = uid,
`feedbackForm`=feed
WHERE `id` = intid;
end if;

update t_candidate
set
`state`=stateid,
`status`=approve
where `id`=cdtid;

insert into `t_action`
SET
`candidateID` = cdtid,
`jdID` = jdid,
`date` = now(),
`state` = stateid,
`status` = approve,
`interviewerID` = uid,
`interviewerRemarks` = rmk,
`rounds` =round,
`modeID` = modeid,
`createdDate` = now(),
`createdBy` = uid,
`lastModifiedDate` = now(),
`lastModifiedBy` = uid;

END ;;
