CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_interviewerFeedbackInfo`(
intid int,cid int,uid int)
BEGIN

SELECT s.id,c.name,c.phone,c.emailID,c.resumeTitle,
s.schedule,r.title,
st.stateName,s.rounds,s.remarks,
s.rating,s.statusId,s.stateId,s.timeTaken,
s.requisitionId,
c.id as cdtid,s.modeId,m.mode,s.feedbackForm,
(SELECT GROUP_CONCAT((select skills from t_skills where id = tcm.skills) SEPARATOR ', ')
FROM t_candidateskillmapping tcm where candidateid =c.id
  GROUP BY candidateid) as skills
 FROM t_scheduleinterview s 
left join t_candidate c on c.id=s.candidateId
left join t_requisition r on s.requisitionId=r.id
left join t_state st on st.id=s.stateId
left join t_mode m on m.id=s.modeId 
where s.id=intid;
END ;;
