CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_parseTableData`(idnew int(11),countFiles int(11))
BEGIN
select c.*, l.location as locationname,
(SELECT GROUP_CONCAT((select skills from t_skills where id = tcm.skills) SEPARATOR ',')
FROM t_candidateskillmapping tcm where tcm.tempCandidateId = c.id GROUP BY candidateid) as skills,
(SELECT GROUP_CONCAT((select id from t_skills where id = tcm.skills) SEPARATOR ',')
FROM t_candidateskillmapping tcm where tcm.tempCandidateId = c.id GROUP BY candidateid) as skillIds
from t_tempcandidate c left join t_location l on l.id = c.location where c.id>idnew and c.id<=countFiles and c.isActive = 1;
END ;;
