CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_projectStatus`(st int,in inUserId int, in inRoleId int,
in inRetailerId int)
BEGIN
if st=1 then
	select u.*,
	concat(ud.firstName,' ',ud.lastName) as lastupdatedby,
	sum(case when b.status =1 then 1 else 0 end ) as openbug,
	sum(case when b.status =4 then 1 else 0 end ) as closedbug
	from t_projectdetails u
	inner join t_retailer l ON u.retailerId = l.id
	left join t_userdetails ud on u.lastModifiedBy=ud.id
	left join t_bug_bugdetails b on u.id=b.projectId
	where u.retailerId=inRetailerId and u.isActive=1 group by u.id;



elseif st=0 then
select u.*,
	concat(ud.firstName,' ',ud.lastName) as lastupdatedby,
	sum(case when b.status =1 then 1 else 0 end ) as openbug,
	sum(case when b.status =4 then 1 else 0 end ) as closedbug
	from t_projectdetails u
	inner join t_retailer l ON u.retailerId = l.id
	left join t_userdetails ud on u.lastModifiedBy=ud.id
	left join t_bug_bugdetails b on u.id=b.projectId
	where u.retailerId=inRetailerId and u.isActive=0 group by u.id;



elseif st=2 then
select u.*,
	concat(ud.firstName,' ',ud.lastName) as lastupdatedby,
	sum(case when b.status =1 then 1 else 0 end ) as openbug,
	sum(case when b.status =4 then 1 else 0 end ) as closedbug
	from t_projectdetails u
	inner join t_retailer l ON u.retailerId = l.id
	left join t_userdetails ud on u.lastModifiedBy=ud.id
	left join t_bug_bugdetails b on u.id=b.projectId
	where u.retailerId=inRetailerId  group by u.id;end if;

END ;;
