CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_removeTag`(tagid int,cid int)
BEGIN
declare count int;
declare c int;
select count(*) from t_action
where jdID=(Select jdid from t_tag t where t.id=tagid) and candidateID=cid and state!=1 into count;
if count>=1 then
select 0;
else

delete from t_tag where id=tagid;
select count(*) from t_tag where candidateID=cid into c;
if c>0 then
update t_candidate t inner join 
(Select state,status,candidateID from t_action where candidateID=11 order by lastModifiedDate desc limit 1
) a on t.id=a.candidateID
set t.state=a.state ,
t.status=a.status;
else
update t_candidate set status=null,state=null where id=cid;
select 1;
end if;
end if;
END ;;
DELIMITER ;
