CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_requisitionData`(in id int(11),retId int)
BEGIN

select * from t_location;
select * from t_skills;
select t.id,t.firstName from t_userdetails t where hrRole = 1 and retailerId=retId;
select * from t_designation;
select * from t_priority;

if id not in (0) then
select * from t_requisition t where t.id=id;
select msk.skill as skill, sk.skills as skillName from t_maprequisitionsskills msk
 join t_skills sk on sk.id=msk.skill
where requisitionId=id;
select id;
select u.firstName as name,rh.columnName,rh.description,rh.modifiedDate as date 
from t_requisitionhistory rh 
join t_userdetails u on rh.modifiedBy=u.id where rh.jdid=id;
select r.id,r.title,r.positions,r.Experience,
r.minimumSalary,r.maximumSalary,l.location,
r.expireDate,r.description,ua.firstName as adminHr,
d.desigName as designation,jt.type,
r.recruiter,p.priority
 from t_requisition r 
left join t_location l on l.id=r.location
left join t_userdetails ua on ua.id=r.adminHr
left join t_designation d on d.id=r.designation 
left join t_priority p on p.id=r.priority 
left join t_jobtype jt on jt.id=r.jobType
where r.id=id;
 
end if;

END ;;
