CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_scheduleInterview`(
cid int,
jdid int,
schdate datetime,
sstate int,
intervid int,
rem varchar(1000),
modeid int,
createdby int,
retId int)
BEGIN
declare count int;
declare rnd int default 0;

select count(1) from t_action where state=sstate and candidateID=cid and jdID=jdid into count;
if count>0 then
select max(rounds) from t_action where state=sstate and candidateID=cid and jdID=jdid into rnd;
set rnd=rnd+1;
else 
set rnd=1;
end if;
INSERT INTO `t_action`
(
`candidateID`,`jdID`,`date`,`state`,`status`,`interviewerID`,
`interviewerRemarks`,`rounds`,`isJoined`,`modeID`,
`createdDate`,`createdBy`,
`lastModifiedDate`,`lastModifiedBy`,`joiningDate`,
`isOffered`,`retailerId`)
VALUES
(cid,jdid,schdate,sstate,3,intervid,rem,rnd,0,modeid,now(),createdby,now(),createdby,0,0,retId);

UPDATE `t_candidate`
SET
`status` = 3,
`state`=sstate
WHERE `id` = cid;

INSERT INTO `t_scheduleinterview`
(
`candidateId`,
`interviewerId`,
`schedule`,
`isDone`,
`requisitionId`,
`stateId`,
`statusId`,
`rounds`,
`modeId`,`retailerId`)
VALUES
(
cid,
intervid,
schdate,
0,
jdid,
sstate,
3,rnd,modeid,retId);


END ;;
