CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_scheduleIntInfo`(cid int,retId int)
BEGIN
#cdt name jd title  cd id , JD id
select t.id as tagId,c.name,t.candidateID,t.jdID,r.title from t_tag t 
left outer join t_requisition r on t.jdID=r.id
 inner join t_candidate c on c.id=t.candidateID
 where t.candidateID=cid;

#get all state
select * from t_state where id!=1;
#interviewer
select * from t_userdetails where hrRole=4 and retailerId=retId;
#mode of interview
select * from t_mode;
#History
/* distinct JD */
select distinct(r.title) from t_action a
join t_requisition r on r.id=a.jdID
 where candidateID=cid;
/* Remaining Schedule info */
select a.id, r.title,st.stateName,ss.statusName,a.rounds,
u.firstName,a.date,a.interviewerRemarks from t_action a 
join t_requisition r on r.id=a.jdID
join t_state st on st.id=a.state
join t_status ss on ss.id=a.status
join t_userdetails u on u.id=a.interviewerID  
where candidateID=cid order by st.id,a.rounds ;

END ;;
