CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_selectAdHr`(selected int(11),retId int)
BEGIN
if selected =  -1 then
select *,(SELECT GROUP_CONCAT((select skills from t_skills where id = skill) SEPARATOR ', ') as skills
FROM t_maprequisitionsskills where requisitionId = r.id GROUP BY requisitionId ) as skills,(select firstName from t_userdetails u where u.id = assignedTo) as assignedTofirstName,(select firstName from t_userdetails where id = adminHr) as adminHrfirstName from t_requisition r where isActive = 1 and isConfirmed = 2 and retailerId=retId;
else 
select *,(SELECT GROUP_CONCAT((select skills from t_skills where id = skill) SEPARATOR ', ') as skills
FROM t_maprequisitionsskills where requisitionId = r.id GROUP BY requisitionId ) as skills,(select firstName from t_userdetails u where u.id = assignedTo) as assignedTofirstName,(select firstName from t_userdetails where id = adminHr) as adminHrfirstName from t_requisition r where isActive = 1 and isConfirmed = 2 and adminHr = selected;
end if; 
END ;;
