CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_submitParsedData`()
BEGIN
insert into t_candidate(`name`,`phone`,`emailID`,`location`,`resumeTitle`,`experienceYears`,`experienceMonths`,`currentLocation`,`ugCourse`,`ugInstitute`)
select name,phone,email,location,targetPath,years,months,permanentAddress ,qualification ,institutes from t_tempcandidate t where t.isActive = 1;

update t_tempcandidate  t
        inner join
    t_candidateskillmapping c ON t.id = c.tempCandidateId
        inner join
    t_candidate tc ON tc.emailID = t.email
set c.candidateid = tc.id
 where t.isActive =1 and t.id>0 and t.email != '';

update t_tempcandidate  t
        inner join
    t_candidateskillmapping c ON t.id = c.tempCandidateId
        inner join
    t_candidate tc ON tc.name = t.name and tc.phone =t.phone 
set c.candidateid = tc.id
 where t.isActive =1 and t.id>0 and tc.name!=''or tc.phone!='' and t.email = '';


update t_tempcandidate set isActive = 0  where id>0;
END ;;
