CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_te_updateholidayById`(in userId int,
in roleId int,in inretailerId int,
in h_id int,in hname varchar(50),in hdate varchar(50))
BEGIN
if h_id=0 then
Select count(1) from t_holiday where holidayName=hname and retailerId=inretailerId 
into @ifExist;
if(@ifExist=0 ) then 
insert into t_holiday (holidayName,holidayDate,retailerId) 
values (hname,hdate,inretailerId);
select 1 as flag;
select * from t_holiday where id=last_insert_id();
else
select 2 as flag;
end if;
else 
Select count(1) from t_holiday where
 holidayName=hname and holidayDate=hdate and retailerId=inretailerId  into @ifExist;
if(@ifExist=0 ) then 
update t_holiday set holidayName=hname,holidayDate=hdate,
retailerId=inretailerId where id=h_id;
select 3 as flag;
select * from t_holiday where id=h_id;
else
select 2 as flag;
end if;
end if;
END ;;
