CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_time_getTime`(usid int,rid int)
BEGIN
Select * from t_time_intervalbyretailer where retailerId=rid;
Select  Distinct projectTitle ,userId  from t_assignment as ts  
inner join t_projectdetails as tp on tp.id=ts.ProjectId 
where userId=usid;

Select WBSName,w.WBSID,assig.id,assig.AssignmentDate,assig.deActivationDate 
from t_wbs as w inner join  t_assignment as assig on w.WBSID=assig.WBSID 
 where assig.userId=usid  ;
Select 1 from t_retailer as tr  inner join t_userdetails as tu where tr.id=rid and tr.emailId=tu.userEmail;
select holidaydate from t_holiday where retailerId=rid;
#select managerId from t_userdetails where id=usid; 

set @t=(select managerId from t_userdetails where id=usid);
set @p=(select roleid from t_userdetails where id=usid);
if @p=1 then 
select "Admin" as mngname ,0 as managerId ;
else 
select concat(firstName," ",lastName) as mngname,@t as managerId from t_userdetails where id=@t;
end if;
Select u.id from t_userdetails as u  where u.managerId=usid;
#Select u.timeApproval from t_userdetails as u  where u.id=usid;
Select usid; 
select schedule from t_timesheet_workschedule where retailerId=rid;
Select u.timeApproval,u.userEmail from t_userdetails as u  where u.id=usid;
END ;;
