CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_updateStatusReq`(
flag int,jdid int,approve varchar(20),uid int)
BEGIN
if approve="approver" then
if flag=1
then
update t_requisition set isConfirmed=2,reviewedBy=uid where id=jdid;
else
update t_requisition set isConfirmed=-2,reviewedBy=uid where id=jdid;
end if;
else
if flag=1
then
update t_requisition set isConfirmed=1,reviewedBy=uid where id=jdid;
else
update t_requisition set isConfirmed=-1,reviewedBy=uid where id=jdid; 
end if;
end if;
select R.*, L.location as locationName from t_requisition R left join t_location L on R.location = L.id  where R.id = jdid;
select userEmail from t_userdetails where roleId = 6 union select userEmail from t_userdetails u where u.id = (select createdBy from t_requisition r where r.id = jdid) ;
SELECT GROUP_CONCAT((select skills from t_skills where id = skill) SEPARATOR ', ') as skills
FROM t_maprequisitionsskills where requisitionId = jdid GROUP BY requisitionId ;
END ;;
