CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_updtMaster`( 
  ccode int,ddesc varchar(500),modiby int,
active tinyint(2), id1 int, in inRetId int,crate int)
begin
select tt.flag as fl from t_mastersdescription tt where
 code=ccode and description1=ddesc;
set @impTemp=(select count('') from  t_mastersdescription tt
 where tt.code=ccode and tt.description1=ddesc and tt.flag=1);

Select count(1) from t_mastersdescription where 
code=ccode and description1=ddesc 
and id !=id1 and (retailerId =inRetId or flag=1)  
into @ifExist;
if(ccode=1) then
Select count(t.id)  from t_mastersdescription t 
inner join t_bug_bugdetails b on t.id=b.status
where t.code=ccode and t.id=id1 and t.retailerId =inRetId into @ifExist2;  
else if ccode=2 then 
Select count(t.id)  from t_mastersdescription t 
inner join t_bug_bugdetails b on t.id=b.priority
where t.code=ccode and t.id=id1 and t.retailerId =inRetId into @ifExist2;
else
if(ccode=3) then
Select count(t.id)  from t_mastersdescription t 
inner join t_bug_bugdetails b on t.id=b.severity
where t.code=ccode and t.id=id1 and t.retailerId =inRetId into @ifExist2;  
end if;
end if;
end if;


if( @ifExist=0 and( ccode=1 or ccode = 2 or ccode = 3 or ccode= 5 or ccode=9)and
 (@ifExist2=0
 or active=1)
 ) then 
update 
t_mastersdescription
 set code=ccode,description1=ddesc,
lastModifiedDate=now(),
lastModifiedBy=modiby,
isActive=active
  where id=id1;	
 Select @ifExist as flag;	
select * from t_mastersdescription where id=last_insert_id();
end if;

if( @ifExist=0 and ( ccode=6 or ccode = 7 or ccode = 4 or ccode= 8)) then 
update t_mastersdescription set code=ccode,description1=ddesc,currencyRate=crate,
lastModifiedDate=now(),lastModifiedBy=modiby,isActive=active
  where id=id1;	
  Select @ifExist as flag;
select * from t_mastersdescription where id=last_insert_id();
end if;




if(@ifExist>0) then
Set @ifExist=2;
end if;

if(@ifExist2>0 and active=0) then
Set @ifExist=3;
end if;

Select @ifExist as flag;


END ;;
DELIMITER ;
