CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_userStatus`(st int,in inUserId int, in inRoleId int,
in inRetailerId int)
BEGIN
if st=1 then
Select 
    u.`id`,
    concat(u.`firstName`, ' ', u.`lastName`) as Name,
    u.`userEmail`,
    u.`contactNumber`,
    l.roleName,
    concat(`m`.`firstName`, ' ', `m`.`lastName`) as managerName,
    u.`isActive`,
    u.`roleId`
 ,
    u.`firstName`,
   u.`lastName`,
    u.`retailerId`
, u.`managerId`
, u.`isBillable`
   , u.`billingAmount`,
u.`isApproval`,
u.`approveLimit`,
    u.`defaultModuleId`,
    u.`isValidated`,
       u.`doj`,
    u.`dob`,
   u.`doc`,
   u.`ecode`,
   u.`designation`,
   u.`level`,
   u.`modules`,
   u.`userId`,
   u.`rtype`,
u.`isClient`,
u.`clientId`,
u.`isRetailer`
from
    t_userdetails u
        inner join
    t_loginroles l ON u.roleId = l.id
     left join
    t_userdetails m ON u.managerId = m.id   
where
    u.retailerId = inRetailerId
and u.isActive=1 ;

else if st=0 then

Select 
    u.`id`,
    concat(u.`firstName`, ' ', u.`lastName`) as Name,
    u.`userEmail`,
    u.`contactNumber`,
    l.roleName,
    concat(`m`.`firstName`, ' ', `m`.`lastName`) as managerName,
