CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_validUser`(userName varchar(100), passcode varchar(100))
BEGIN
if userName is not null and passcode is not null then
select u.*,rt.logo from t_userdetails u
 inner join t_retailer rt on rt.id=u.retailerId
 where u.userEmail=userName and u.userPassword=passcode 
and isValidated=1;

Select count(1) from t_retailer where emailId=userName into @isretailer;
if @isretailer>0 then
Select p.*,rt.logo from t_userdetails u 
inner join t_retailer rt on u.userEmail=rt.emailId
left join t_retailermodulemapping rm on rt.id=rm.retailerId
inner join t_portalmodules p on p.id=rm.moduleId
where  u.userEmail=userName 
and u.isValidated=1; 

else 






SELECT p.* FROM portal.t_userdetails u left join t_usermodulemapping um on u.id=um.userId
inner join t_portalmodules p on p.id=um.moduleId
where u.userEmail=userName and
 u.isValidated=1;


end if ;


/*
