CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_verifyUserViaEmail`(email varchar(200))
BEGIN
update t_userdetails set isValidated=1 where userEmail =email;
select * from t_userdetails where userEmail=email;
 #and userPassword=passcode;

Select count(1) from t_retailer where emailId=email into @isretailer;
if @isretailer>0 then
/*
SELECT p.* FROM portal.t_userdetails u 
left join t_retailermodulemapping rm on u.id=rm.retailerId
inner join t_portalmodules p on p.id=rm.moduleId
where  u.userEmail=email 
and u.isValidated=1;
*/


Select p.* from t_userdetails u 
inner join t_retailer rt on u.userEmail=rt.emailId
left join t_retailermodulemapping rm on rt.id=rm.retailerId
inner join t_portalmodules p on p.id=rm.moduleId
where  u.userEmail=email 
and u.isValidated=1; 
else 

SELECT p.* FROM portal.t_userdetails u left join t_usermodulemapping um on u.id=um.userId
inner join t_portalmodules p on p.id=um.moduleId
where u.userEmail=email and
 u.isValidated=1;
end if ;


END ;;
