CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_viewCandidate`(retId int)
BEGIN
select 
c.id,
name,phone,
emailID,
l.location,
(SELECT GROUP_CONCAT((select skills from t_skills where id = tcm.skills) SEPARATOR ', ')
FROM t_candidateskillmapping tcm where candidateid = c.id GROUP BY candidateid) as skills,
st.stateName,
s.statusName,
c.resumeTitle
,count(t.candidateID) as countTag
from t_candidate c
left join t_tag t on   c.id  = t.candidateID
left join t_location l on c.location=l.id
left outer join t_status s on s.id=c.status
left outer join t_state st on st.id=c.state
where retailerId=retId group by c.id order by 1  desc;

#Skills for parsing
select id,keyword,skills from t_skills;
select * from t_location;
select * from t_institutes;



END ;;
