CREATE DEFINER=`polestarportal`@`%` PROCEDURE `usp_viewreq`(uid int(11),retId int)
BEGIN
select *,(SELECT GROUP_CONCAT((select skills from t_skills where id = skill) SEPARATOR ', ') as skills
FROM t_maprequisitionsskills where requisitionId = r.id GROUP BY requisitionId ) as skills,
(select firstName from t_userdetails u where u.id = assignedTo) as assignedToName,
(select firstName from t_userdetails where id = adminHr) as adminHrname 
from t_requisition r
where isActive = 1 and isConfirmed =2 and adminHr = uid and retailerId=retId;

select id,firstName from t_userdetails where hrRole = 2 and retailerId=retId;
select id ,firstName from t_userdetails where hrRole = 1 and retailerId=retId;
END ;;
